import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-book-tickets',
  templateUrl: './book-tickets.component.html',
  styleUrls: ['./book-tickets.component.css']
})
export class BookTicketsComponent implements OnInit {
  movie = { title: 'Devara - Part 1', language: 'Telugu' };
  selectedCinema = { name: 'AAA Cinemas: Ameerpet' };
  selectedDate = new Date();
  showtimes = [
    { start: new Date(new Date().setHours(10, 0)) },
    { start: new Date(new Date().setHours(13, 0)) },
    { start: new Date(new Date().setHours(16, 0)) },
    { start: new Date(new Date().setHours(19, 0)) }
  ];
  selectedShowtime: any = null;
  numberOfSeats = 1;

  constructor() { }

  ngOnInit(): void { }

  selectShowtime(showtime: any) {
    this.selectedShowtime = showtime;
  }

  changeSeatCount(change: number) {
    this.numberOfSeats = Math.max(1, this.numberOfSeats + change);
  }

  goToSeatSelection() {
    // Navigate to the seat map selection component
    // Implement navigation logic as needed, potentially storing state with a service or directly passing data
  }
}
<div class="cinema-details">
  <h1>{{ movie.title }} - {{ movie.language }}</h1>
  <p>{{ selectedCinema.name }} | {{ selectedDate | date:'fullDate' }}</p>

  <!-- Showtimes Buttons -->
  <div class="showtimes-container">
    <button *ngFor="let showtime of showtimes" (click)="selectShowtime(showtime)"
            [class.active]="showtime === selectedShowtime"
            class="showtime-button">
      {{ showtime.start | date:'shortTime' }}
    </button>
  </div>

  <!-- Seat Selection Prompt -->
  <div *ngIf="selectedShowtime" class="seat-selection-prompt">
    <p>How Many Seats?</p>
    <div class="seat-count-selector">
      <button (click)="changeSeatCount(-1)">-</button>
      <span>{{ numberOfSeats }}</span>
      <button (click)="changeSeatCount(1)">+</button>
    </div>
    <button (click)="goToSeatSelection()" class="select-seats-btn">Select Seats</button>
  </div>
</div>
